import React from 'react';
import './App.css';
import { BrowserRouter, Switch } from 'react-router-dom';
import Login from './pages/Login';

export default function App() {
  return (
    <BrowserRouter>
      <Switch />
      <Login />
    </BrowserRouter>
  );
}
